{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/fcolemanearly/cyclistic-case-study?scriptVersionId=165465642\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"bb1b6336","metadata":{"papermill":{"duration":0.01327,"end_time":"2024-03-04T23:21:32.344179","exception":false,"start_time":"2024-03-04T23:21:32.330909","status":"completed"},"tags":[]},"source":["# Introduction"]},{"cell_type":"markdown","id":"be1e6e57","metadata":{"papermill":{"duration":0.011958,"end_time":"2024-03-04T23:21:32.368416","exception":false,"start_time":"2024-03-04T23:21:32.356458","status":"completed"},"tags":[]},"source":["**Scenario**\n","\n","You are a junior data analyst working on the marketing analyst team at Cyclistic, a bike-share\n","company in Chicago. The director of marketing believes the company’s future success\n","depends on maximizing the number of annual memberships. Therefore, your team wants to\n","understand how casual riders and annual members use Cyclistic bikes differently. From these\n","insights, your team will design a new marketing strategy to convert casual riders into annual\n","members. But first, Cyclistic executives must approve your recommendations, so they must be\n","backed up with compelling data insights and professional data visualizations.\n","\n","\n","**Characters and teams**\n","\n","*Cyclistic:* A bike-share program that features more than 5,800 bicycles and 600\n","docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand\n","tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities\n","and riders who can’t use a standard two-wheeled bike. The majority of riders opt for\n","traditional bikes; about 8% of riders use the assistive options. Cyclistic users are more\n","likely to ride for leisure, but about 30% use the bikes to commute to work each day.\n","\n","*Lily Moreno:* The director of marketing and your manager. Moreno is responsible for\n","the development of campaigns and initiatives to promote the bike-share program.\n","These may include email, social media, and other channels.\n","\n","*Cyclistic marketing analytics team:* A team of data analysts who are responsible for\n","collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","You joined this team six months ago and have been busy learning about Cyclistic’s\n","mission and business goals—as well as how you, as a junior data analyst, can help\n","Cyclistic achieve them.\n","\n","*Cyclistic executive team:* The notoriously detail-oriented executive team will decide\n","whether to approve the recommended marketing program.\n","\n","\n","**About the company**\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown\n","to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations\n","across Chicago. The bikes can be unlocked from one station and returned to any other station\n","in the system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to\n","broad consumer segments. One approach that helped make these things possible was the\n","flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships.\n","\n","Customers who purchase single-ride or full-day passes are referred to as casual riders.\n","Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable\n","than casual riders. Although the pricing flexibility helps Cyclistic attract more customers,\n","Moreno believes that maximizing the number of annual members will be key to future growth.\n","Rather than creating a marketing campaign that targets all-new customers, Moreno believes\n","there is a solid opportunity to convert casual riders into members. She notes that casual riders\n","are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into\n","annual members. In order to do that, however, the team needs to better understand how\n","annual members and casual riders differ, why casual riders would buy a membership, and how\n","digital media could affect their marketing tactics. Moreno and her team are interested in\n","analyzing the Cyclistic historical bike trip data to identify trends."]},{"cell_type":"markdown","id":"40fe2956","metadata":{"papermill":{"duration":0.01237,"end_time":"2024-03-04T23:21:32.392686","exception":false,"start_time":"2024-03-04T23:21:32.380316","status":"completed"},"tags":[]},"source":["# Ask"]},{"cell_type":"markdown","id":"df3359ef","metadata":{"papermill":{"duration":0.011889,"end_time":"2024-03-04T23:21:32.416466","exception":false,"start_time":"2024-03-04T23:21:32.404577","status":"completed"},"tags":[]},"source":["Three questions will guide the future marketing program:\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","\n","\n","Moreno has assigned you the first question to answer: How do annual members and casual riders use Cyclistic bikes differently?\n","\n","You will produce a report with the following deliverables:\n","1. A clear statement of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of your analysis\n","5. Supporting visualizations and key findings\n","6. Your top three recommendations based on your analysis"]},{"cell_type":"markdown","id":"176b1871","metadata":{"papermill":{"duration":0.01204,"end_time":"2024-03-04T23:21:32.440819","exception":false,"start_time":"2024-03-04T23:21:32.428779","status":"completed"},"tags":[]},"source":["**Case Study Roadmap - Ask**\n","\n","Guiding questions:\n","* What is the problem you are trying to solve?\n","* How can your insights drive business decisions?\n","\n","Key tasks:\n","* Identify the business task\n","* Consider key stakeholders\n","\n","Deliverable:\n","* A clear statement of the business task\n"]},{"cell_type":"markdown","id":"1e40175e","metadata":{"papermill":{"duration":0.011744,"end_time":"2024-03-04T23:21:32.464565","exception":false,"start_time":"2024-03-04T23:21:32.452821","status":"completed"},"tags":[]},"source":["# Prepare"]},{"cell_type":"markdown","id":"15e48de6","metadata":{"papermill":{"duration":0.011919,"end_time":"2024-03-04T23:21:32.488534","exception":false,"start_time":"2024-03-04T23:21:32.476615","status":"completed"},"tags":[]},"source":["Use Cyclistic’s historical trip data to analyze and identify trends. Download the previous 12\n","months of Cyclistic trip data here. (Note: The datasets have a different name because Cyclistic\n","is a fictional company. For the purposes of this case study, the datasets are appropriate and\n","will enable you to answer the business questions. The data has been made available by\n","Motivate International Inc. under this license.) This is public data that you can use to explore\n","how different customer types are using Cyclistic bikes. But note that data-privacy issues\n","prohibit you from using riders’ personally identifiable information. This means that you won’t be\n","able to connect pass purchases to credit card numbers to determine if casual riders live in the\n","Cyclistic service area or if they have purchased multiple single passes."]},{"cell_type":"markdown","id":"db3a582a","metadata":{"papermill":{"duration":0.011692,"end_time":"2024-03-04T23:21:32.512149","exception":false,"start_time":"2024-03-04T23:21:32.500457","status":"completed"},"tags":[]},"source":["**Case Study Roadmap - Prepare**\n","\n","Guiding questions:\n","* Where is your data located?\n","* How is the data organized?\n","* Are there issues with bias or credibility in this data? Does your data ROCCC?\n","* How are you addressing licensing, privacy, security, and accessibility?\n","* How did you verify the data’s integrity?\n","* How does it help you answer your question?\n","* Are there any problems with the data?\n","\n","Key tasks:\n","* Download data and store it appropriately.\n","* Identify how it’s organized.\n","* Sort and filter the data.\n","* Determine the credibility of the data.\n","\n","Deliverable:\n","* A description of all data sources used"]},{"cell_type":"markdown","id":"34669a35","metadata":{"papermill":{"duration":0.011831,"end_time":"2024-03-04T23:21:32.535699","exception":false,"start_time":"2024-03-04T23:21:32.523868","status":"completed"},"tags":[]},"source":["**Preparations for Data Retrieval**"]},{"cell_type":"code","execution_count":1,"id":"7968b857","metadata":{"execution":{"iopub.execute_input":"2024-03-04T23:21:32.562993Z","iopub.status.busy":"2024-03-04T23:21:32.561139Z","iopub.status.idle":"2024-03-04T23:21:33.518709Z","shell.execute_reply":"2024-03-04T23:21:33.517048Z"},"papermill":{"duration":0.97411,"end_time":"2024-03-04T23:21:33.521569","exception":false,"start_time":"2024-03-04T23:21:32.547459","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b